import Recat from 'react';
import categoryColors from "./styles.js";
import './css/tag-row.css'

export default function TagRow({tags}){
  return (
    <div className="tags-container">
    {tags.map((tag, index) => {
      return (
        <span
          key={index}
          className="tag"
          style={{ backgroundColor: categoryColors[tag] }}
        >
          {tag.toUpperCase()}
        </span>
      );
    })}
  </div>
  )
}
